import React, { useState } from "react";

const Todo = () => {
  const [input, setInput] = useState("");
  const [list, setList] = useState([]);

  const addTodo=(e)=>{
    e.preventDefault();
    if(input){
      setList([...list, input]);
      setInput("");
    }
    console.log(list)
  }
  return (
    <div>
      <input
        type="text"
        placeholder="enter test"
        onChange={(e) => setInput(e.target.value)}
      />
      <button onClick={addTodo}>Add</button>
      {list.map((t, i) =>(
        <div key={i}>{t}</div>
      ))}
    </div>
  );
};

export default Todo;
